import React from "react";

import Layout from "../components/Layout";

const Home = () => {
  return (
    <React.Fragment>
      <Layout>
        <main>
          <h1>Home</h1>
        </main>
      </Layout>

      <style jsx>{`
        main {
          height: 900px;
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Home;
